dna = ""
rc_dna = ""

for i in range(len(dna)):
	if dna[len(dna)-(i+1)] == "T":
		rc_dna = rc_dna + "A"
	elif dna[len(dna)-(i+1)] == "A":
		rc_dna = rc_dna + "T"
	elif dna[len(dna)-(i+1)] == "C":
		rc_dna = rc_dna + "G"
	elif dna[len(dna)-(i+1)] == "G":
		rc_dna = rc_dna + "C"


tempW = open('output_BA1C.txt', 'w')
tempW.write(rc_dna)
tempW.close()		